import React from 'react';
import styles from './Settings.module.css'; // Make sure this path matches

const Settings = () => {
    const handleClearCache = () => {
        console.log('Clear cache');
        // Implement cache clearing logic here
    };

    const handleChangeTheme = () => {
        console.log('Change theme');
        // Implement theme changing logic here
    };

    const handleGetAuthorization = () => {
        console.log('Get authorization');
        // Implement authorization logic here
    };

    return (
        <section className={styles.settingsSection}>
            <table className={styles.settingsTable}>
                <tbody>
                    <tr>
                        <td>
                            <label htmlFor="clearCache" className={styles.label}>Cache</label>
                        </td>
                        <td>
                            <button id="clearCache" onClick={handleClearCache} className={styles.button}>Clear Cache</button>
                        </td>
                    </tr>
                    <tr>
                        <td>
                            <label htmlFor="themeSwap" className={styles.label}>Theme</label>
                        </td>
                        <td>
                            <button id="themeSwap" onClick={handleChangeTheme} className={styles.button}>Change Theme</button>
                        </td>
                    </tr>
                    <tr>
                        <td>
                            <label htmlFor="getAuth" className={styles.label}>Auth</label>
                        </td>
                        <td>
                            <button id="getAuth" onClick={handleGetAuthorization} className={styles.button}>Get Authorization</button>
                        </td>
                    </tr>
                </tbody>
            </table>
        </section>
    );
};

export default Settings;
